// src/components/EnrollmentForm.js
import React, { useState, useEffect } from 'react';

const EnrollmentForm = () => {
    const [formData, setFormData] = useState({
        name: '',
        age: 18,
        selectedBatch: '',
    });
    const [fee, setFee] = useState(500);
    const [summaryVisible, setSummaryVisible] = useState(false);
    const [paymentStatus, setPaymentStatus] = useState(null);

    useEffect(() => {
        // Recalculate fee based on age (just a simple example)
        const ageBasedFee = formData.age >= 50 ? 600 : 500;
        setFee(ageBasedFee);
    }, [formData.age]);

    const handleInputChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleBatchChange = (e) => {
        setFormData({ ...formData, selectedBatch: e.target.value });
    };

    

    const CompletePayment = async (userData, paymentAmount) => {
        // Mocked function, you can implement the actual payment logic here
        return new Promise((resolve) => {
            setTimeout(() => {
                const success = Math.random() < 0.8; // 80% success rate, adjust as needed
                resolve({
                    status: success ? 'success' : 'failure',
                    message: success ? 'Payment successful' : 'Payment failed',
                });
            }, 1000); // Simulate payment processing delay
        });
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.header}>Yoga Class Enrollment Form</h2>
            <form onSubmit={handleSubmit} style={styles.form}>
                <label style={styles.label}>
                    Name:
                    <input
                        type="text"
                        name="name"
                        value={formData.name}
                        onChange={handleInputChange}
                        required
                        style={styles.input}
                    />
                </label>
                <br />
                <label style={styles.label}>
                    Age:
                    <input
                        type="number"
                        name="age"
                        value={formData.age}
                        onChange={handleInputChange}
                        min="18"
                        max="65"
                        required
                        style={styles.input}
                    />
                </label>
                <br />
                <label style={styles.label}>
                    Select Batch:
                    <select
                        name="selectedBatch"
                        value={formData.selectedBatch}
                        onChange={handleBatchChange}
                        required
                        style={styles.input}
                    >
                        <option value="">-- Select Batch --</option>
                        <option value="6-7AM">6-7AM</option>
                        <option value="7-8AM">7-8AM</option>
                        <option value="8-9AM">8-9AM</option>
                        <option value="5-6PM">5-6PM</option>
                    </select>
                </label>
                <br />
                <button type="submit" style={styles.button}>
                    Enroll
                </button>
            </form>

            {summaryVisible && (
                <div style={styles.summary}>
                    <h3>Enrollment Summary</h3>
                    <p>Name: {formData.name}</p>
                    <p>Age: {formData.age}</p>
                    <p>Selected Batch: {formData.selectedBatch}</p>
                    <p>Total Fee: Rs {fee}</p>
                    <p>Payment Status: {paymentStatus}</p>
                </div>
            )}
        </div>
    );
};

const styles = {
    container: {
        textAlign: 'center',
        marginTop: '50px',
    },
    header: {
        color: '#333',
    },
    form: {
        width: '300px',
        margin: 'auto',
        padding: '20px',
        boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
        borderRadius: '5px',
        backgroundColor: '#fff',
    },
    label: {
        display: 'block',
        margin: '10px 0',
        color: '#555',
    },
    input: {
        width: '100%',
        padding: '8px',
        boxSizing: 'border-box',
        border: '1px solid #ccc',
        borderRadius: '3px',
    },
    button: {
        backgroundColor: '#4CAF50',
        color: 'white',
        padding: '10px',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
    },
    summary: {
        marginTop: '20px',
        padding: '20px',
        boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
        borderRadius: '5px',
        backgroundColor: '#f0f0f0',
    },
};

export default EnrollmentForm;
